winrate_gps_saql_1.query:
q = load "Load_opty_services_acct_all";
q = filter q by 'OpportunityServices__c.gCRM_GPS_Stage_US__c' in ["Closed Lost", "Closed Won"];
{{cell(OptyRoleToggle_1.selection, 0, "saql_filter").asString()}}"{{cell(UserData.selection, 0, "Id").asString()}}";
q = foreach q generate 'OpportunityServices__c.gCRM_GPS_Stage_US__c' as 'OpportunityServices__c.gCRM_GPS_Stage_US__c', unique(q.'OpportunityServices__c.gCRM_Opportunity_ID__c') as 'B', sum(q.'OpportunityServices__c.gCRM_Amount_USD__c') as 'C';
q = group q by 'OpportunityServices__c.gCRM_GPS_Stage_US__c';
q = order q by 'OpportunityServices__c.gCRM_GPS_Stage_US__c' desc;
q = foreach q generate 'OpportunityServices__c.gCRM_GPS_Stage_US__c', sum(B) as 'B', sum('C') as 'C', sum(B)/sum(sum(B)) over ([..] partition by all) as 'Win Rate Count', sum(C)/sum(sum(C)) over ([..] partition by all) as 'Win Rate Amount';
q = limit q 10;

