lens_2.query:
q = load "Load_CustomTeam_Opty";
{{cell(OptyRoleToggle_1.selection, 0, "saql_filter_sc").asString()}}"{{cell(UserData.selection, 0, "Id").asString()}}";
q = filter q by 'Opty.gCRM_GPS_Stage_US__c' in ["Closed Won", "Closed Abandoned", "Closed Lost"];
q = group q by ('Opty.Name', 'Opty.gCRM_Opportunity_ID__c', 'Opty.gCRM_English_Account_Name__c', 'Opty.gCRM_Actual_Close_Date__c', 'Opty.gCRM_Reason_for_Won_Lost_Abandoned__c', 'Opty.gCRM_GPS_Stage_US__c');
q = foreach q generate q.'Opty.Name' as 'Opportunity Name', q.'Opty.gCRM_Opportunity_ID__c' as 'Opty.gCRM_Opportunity_ID__c', q.'Opty.gCRM_English_Account_Name__c' as 'English Account Name', sum(q.'Opty.gCRM_Amount_USD__c') as 'TGOA (converted)', sum(q.'gCRM_Sales_Credit_Amount__c') as 'Sales Credit Amount', substr(date_to_string(toDate(q.'Opty.gCRM_Actual_Close_Date__c', "yyyy-MM-dd"), "MM/dd/yyyy"), 1, 10) as 'Actual Close Date', q.'Opty.gCRM_Reason_for_Won_Lost_Abandoned__c' as 'Closed Reason', q.'Opty.gCRM_GPS_Stage_US__c' as 'GPS Stage';
q = order q by 'Actual Close Date' desc;
q = limit q 2000;
